import { Fragment } from "react";
import "./mealItem.css"

function MealItem(props)
{
    return(
        <Fragment>
            <h2>
                {props.item.name}
            </h2>
            <h3>
                {props.item.description}
            </h3>
            <h2>
                ${props.item.price.toString()}
            </h2>
        </Fragment>
    )
}

export default MealItem;
